import React from 'react';
import './App.css';

function Box(props) {
  return (
    <div className="App">
      <div className="">
        <button className="case red" onClick={this.props.changeColor("red")}></button>
        <button className="case yellow"></button>
        <button className="case blue"></button>
        <button className="case green"></button>
        <button className="case purple"></button>
      </div>
    </div>
  );
}

export default Box;
